	module.exports = {"title":"El Nio Recipe","date":"2014-04-01T00:00:00.000Z","body":"<h2>El Nio</h2>\n<p>This is the one cocktail in the collection that I didnt create. My friend <a href=\"https://twitter.com/jcoltkelly\">Josh Kelly</a> devised this recipe, and on a trip to the beach after many iterations we pronounced it good. Right click and <a href=\"#highball-import\">save the image</a> to import into <a href=\"http://www.studioneat.com/products/highball\">Highball</a>.</p>\n<h3>Ingredients</h3>\n<ul>\n<li>1oz Tequila</li>\n<li>1oz Pear liqueur</li>\n<li>1/2 oz Lime juice</li>\n<li>1/4oz Allspice dram</li>\n<li>1/4oz Simple syrup</li>\n<li>1 dash grapefruit bitters</li>\n<li>1 twist of lime</li>\n</ul>\n<p>Combine ingredients in a shaker with ice. Shake vigorously. Strain into a coupe glass. Garnish with a twist of lime.</p>\n<a name=\"highball-import\">\n  <img src=\"/img/cocktails/el-nino.png\" \n    class=\"raised\"\n    alt=\"Recipe for El Nio\" />\n</a>"}

