	module.exports = {"title":"Cocktail Recipes","body":"<h2>Cocktail Recipes</h2>\n<p>A small but growing collection of cocktails that I have created. I use <a href=\"http://www.studioneat.com/products/highball\">Highball</a> on my phone to keep track of the recipes. I have no connection to <a href=\"http://www.studioneat.com/\">Studio Neat</a> who makes it. Its just a nice app. You should check it out.</p>\n<ul>\n<li><a href=\"/cocktails/yippee-kay-yay-motherfucker/\">Yippee Kay Yay Motherfucker!</a></li>\n<li><a href=\"/cocktails/johnny-appleseed/\">Johnny Appleseed</a></li>\n<li><a href=\"/cocktails/el-nino/\">El Nio</a></li>\n<li><a href=\"/cocktails/la-pomme-forte/\">La Pomme Forte</a></li>\n<li><a href=\"/cocktails/slightly-sour-strawberry-smash/\">Slightly Sour Strawberry Smash</a></li>\n</ul>\n"}

